import React from 'react';

const Cards = ({ people }) => {
	return(
		<div>		
			<h1>{ people.name }</h1>
			<h2>{ people.height }</h2>
			<h2>{ people.eye_color }</h2>
		</div>			
	)
}

export default Cards;
